//import { defineStore } from 'pinia'
import IdentityManager from '@arcgis/core/identity/IdentityManager'
import Credential from '@arcgis/core/identity/Credential'
import OAuthInfo from '@arcgis/core/identity/OAuthInfo'
import { appId, portalUrl, urlCallback } from '../config'
import Portal from '@arcgis/core/portal/Portal'

// Register application ID, Portal URL, and urlCallback with the IdentityManager
const oauthInfo = new OAuthInfo({
    appId: appId,
    portalUrl: portalUrl,
    flowType: "authorization-code",
    popup: true,
    popupCallbackUrl: urlCallback 
})

export const initialize = () => {
    try { IdentityManager.registerOAuthInfos([oauthInfo]) }
    catch(error) { console.log(error) }
    finally{ console.log("Initializing") }
}
